import TitleMenu from './TitleMenu';
import TitleTab from './TitleTab';

function TitleLayout() {
  return (
    <div className="Layout__Title flex flex-column">
      <TitleMenu />
      <TitleTab />
    </div>
  );
}

export default TitleLayout;
